import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

const SymptomTracker = () => {
  const days = ["Mon", "Tues", "Wed", "Thur", "Fri", "Sat", "Sun"];
  const allSymptoms = [
    "Fatigue",
    "Joint pain",
    "Stiffness",
    "Swelling",
    "Tenderness",
    "Limited range of motion",
    "Muscle weakness",
  ];
  const moods = ["Sad", "Neutral", "Happy"];

  const [text, setText] = useState("");
  const [painLevel, setPainLevel] = useState("1");
  const [selectedDay, setSelectedDay] = useState(null);
  const [selectedSymptoms, setSelectedSymptoms] = useState([]);
  const [selectedMood, setSelectedMood] = useState(null);

  const navigate = useNavigate();

  const goBack = () => navigate("/dashboard");
  const handleText = (e) => setText(e.target.value);
  const handlePainChange = (e) => setPainLevel(e.target.value);
  const handleDayClick = (day) => setSelectedDay(day === selectedDay ? null : day);
  const handleSymptomToggle = (symptom) => {
    setSelectedSymptoms((prev) =>
      prev.includes(symptom)
        ? prev.filter((s) => s !== symptom)
        : [...prev, symptom]
    );
  };
  const handleMoodClick = (mood) => {
    setSelectedMood(mood === selectedMood ? null : mood);
  };

  return (
    <div className="min-h-screen p-6 flex flex-col items-center bg-gray-50">
      {/* Header */}
      <div className="flex items-center gap-4 mb-8 w-full max-w-5xl mx-auto">
        <button onClick={goBack}>
          <svg
            width="60"
            height="70"
            viewBox="0 0 48 48"
            fill="none"
            xmlns="http://www.w3.org/2000/svg"
          >
            <rect width="48" height="48" rx="16" fill="white" />
            <rect x="0.5" y="0.5" width="47" height="47" rx="15.5" stroke="black" strokeOpacity="0.35" />
            <path
              fillRule="evenodd"
              clipRule="evenodd"
              d="M26.9315 27.9596C27.1647 28.1969 27.1655 28.5824 26.9333 28.8207C26.7221 29.0374 26.391 29.0577 26.1573 28.8814L26.0904 28.8226L21.2824 23.9319C21.0697 23.7155 21.0504 23.3761 21.2244 23.1373L21.2824 23.069L26.0903 18.1775C26.3236 17.9402 26.701 17.941 26.9332 18.1792C27.1444 18.3959 27.1629 18.7342 26.9893 18.9722L26.9315 19.0403L22.5479 23.5006L26.9315 27.9596Z"
              fill="#040415"
            />
          </svg>
        </button>
        <h2 className="text-3xl font-bold text-black">Symptom Tracker</h2>
      </div>

      {/* Weekly Log */}
      <div className="mb-4 w-full max-w-5xl mx-auto">
        <h2 className="text-lg font-semibold text-black mb-2">Weekly Log</h2>
        <div className="flex justify-between gap-4">
          {days.map((day) => (
            <button
              key={day}
              onClick={() => handleDayClick(day)}
              className="flex flex-col items-center"
            >
              <svg
                xmlns="http://www.w3.org/2000/svg"
                width="50"
                height="40"
                viewBox="0 0 26 25"
                fill="none"
                className="mb-1"
              >
                <path
                  d="M21.5938 23.4375H4.40625C3.1123 23.4375 2.0625 22.3877 2.0625 21.0938V3.90625C2.0625 2.6123 3.1123 1.5625 4.40625 1.5625H21.5938C22.8877 1.5625 23.9375 2.6123 23.9375 3.90625V21.0938C23.9375 22.3877 22.8877 23.4375 21.5938 23.4375ZM13.6885 8.68652L7.0625 15.3125L6.75488 18.1006C6.71582 18.4717 7.02832 18.7891 7.4043 18.75L10.1924 18.4424L16.8184 11.8164C16.9307 11.7041 16.9307 11.5186 16.8184 11.4014L14.1084 8.69141C13.9863 8.57422 13.8008 8.57422 13.6885 8.68652Z"
                  fill={selectedDay === day ? "#407CE2" : "#D9D9D9"}
                />
              </svg>
              <span className="text-sm font-medium">{day}</span>
            </button>
          ))}
        </div>
      </div>

      {/* Daily Log */}
      <div className="w-full max-w-5xl bg-white border border-gray-300 rounded-2xl p-6 mb-10 shadow-sm">
        <div className="flex justify-between items-center mb-4">
          <h3 className="text-xl font-bold text-black">Daily Log</h3>
          <div className="rounded-full border p-3">
            <svg
              xmlns="http://www.w3.org/2000/svg"
              width="24"
              height="24"
              viewBox="0 0 26 26"
              fill="none"
            >
              <path
                fillRule="evenodd"
                clipRule="evenodd"
                d="M19.9323 4.03013L21.2823 5.38013C22.0723 6.16013 22.0723 7.43013 21.2823 8.21013L8.05231 21.4401H3.87231V17.2601L14.2723 6.85013L17.1023 4.03013C17.8823 3.25013 19.1523 3.25013 19.9323 4.03013ZM5.87231 19.4401L7.28231 19.5001L17.1023 9.67013L15.6923 8.26013L5.87231 18.0801V19.4401Z"
                fill="#407CE2"
              />
            </svg>
          </div>
        </div>

        {/* Symptoms */}
        <div className="mb-6">
          <h4 className="text-lg font-semibold text-gray-800 mb-2">Choose your symptoms</h4>
          <div className="flex flex-wrap gap-2">
            {allSymptoms.map((symptom) => (
              <label
                key={symptom}
                className={`px-3 py-1 rounded-full border-2 text-sm font-medium cursor-pointer ${
                  selectedSymptoms.includes(symptom)
                    ? "border-blue-400 bg-blue-100 text-blue-700"
                    : "border-gray-300 bg-gray-100 text-gray-700"
                }`}
              >
                <input
                  type="checkbox"
                  className="sr-only"
                  checked={selectedSymptoms.includes(symptom)}
                  onChange={() => handleSymptomToggle(symptom)}
                />
                {symptom}
              </label>
            ))}
          </div>
        </div>

        {/* Notes */}
        <textarea
          id="notes"
          value={text}
          onChange={handleText}
          placeholder="Type how you feel..."
          className="w-full h-40 resize-none rounded-md border border-gray-300 bg-[#ECF1FF] p-3 text-md focus:outline-none focus:ring-2 focus:ring-blue-300"
        />
      </div>

      {/* Pain Level */}
      <div className="w-full max-w-5xl mb-6">
        <label className="text-md text-black font-semibold block mb-2">Pain Level</label>
        <select
          value={painLevel}
          onChange={handlePainChange}
          className="w-full max-w-sm px-4 py-2 border border-gray-300 rounded-md bg-white text-md shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-300"
        >
          {[...Array(10)].map((_, i) => (
            <option key={i + 1} value={i + 1}>
              {i + 1}
            </option>
          ))}
        </select>
      </div>

      {/* Mood Tracker */}
      <div className="w-full max-w-5xl mb-12 text-center">
        <h4 className="text-md font-semibold mb-2">Mood Tracker</h4>
        <div className="flex justify-center gap-6">
          {moods.map((mood) => (
            <div
              key={mood}
              onClick={() => handleMoodClick(mood)}
              className={`cursor-pointer rounded-full p-4 text-lg font-medium ${
                selectedMood === mood ? "bg-blue-100 text-blue-700" : "bg-gray-100 text-gray-800"
              }`}
            >
              {mood}
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default SymptomTracker;
